    + (PV(1,1)*ST(1,3)*s(1)*s(2)-PV(2,1)*ST(2,3)*s(1)^2-PV(1,2)*ST(3,2)*s(2)*s(3)-PV(1,3)*ST(3,3)*s(2)*s(3)-PV(2,1)*ST(3,2)*s(2)*s(3))*EQQQ(2,6,3)...
