    + (PV(1,2)*ST(1,3)*s(2)*s(3)+PV(1,2)*ST(3,1)*s(1)*s(2)+PV(2,2)*ST(2,3)*s(1)*s(3)-PV(2,1)*ST(3,1)*s(1)*s(2)-PV(2,3)*ST(3,3)*s(1)*s(2))*EQQQ(2,6,7)...
